import React from 'react'
import './App.css';
import './Menu'
import Main from './Main'
import Menu from './Menu';
import { useNavigate } from "react-router-dom"

function App() {

  let navigate = useNavigate(); 

  const routeChange = () =>{ 
      let path = "./Login"; 
      navigate(path);
  }

  let loginBtn = <button className="btn" onClick={routeChange}>Sign In</button>

  return (
    <div className="app">



      <Menu Login={loginBtn}/>


      <Main />


    </div>
  );
}

export default App;
